using System;
using System.Collections.Generic;
using System.Linq;
using System.Text;

namespace Chapter_String
{
    internal class FirstUniqueCharacter
    {
        public static void OnMain()
        {
            //Console.WriteLine(FirstUniqChar("loveleetcode"));
            //Console.WriteLine(FirstUniqChar("lovevletetdcodce"));
            Console.WriteLine(FirstUniqChar(""));
        }

        public static int FirstUniqChar(string s)
        {
            var hash = s.ToHashSet();
            foreach (var item in hash)
            {
                if (s.Count(c => c == item) == 1)
                {
                    return s.IndexOf(item);
                }
            }
            return -1;
        }
    }
}